import { useEffect, useState } from "react";
import React from "react";
import { fetchData } from "../api";

export default function ExchangeData() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  // Fetch data on component mount
  useEffect(() => {
    const getData = async () => {
      try {
        const result = await fetchData("exchangeData");
        console.log("Fetched Data:", result); // Log fetched data to check format
        if (Array.isArray(result)) {
          setData(result); // Set data only if it's an array
        } else if (result && typeof result === "object") {
          // Convert object values to an array
          setData(Object.values(result));
        } else {
          setData([]); // Fallback to an empty array
        }
      } catch (err) {
        console.error("Error fetching data:", err.message);
        setError(err.message);
      }
    };
    getData();
  }, []);

  if (error)
    return <p className="text-center text-red-500 font-semibold">Error: {error}</p>;
  if (!data || data.length === 0)
    return <p className="text-center text-gray-500 font-semibold">loading....</p>;

  return (
    <div className="p-4">
      <h2 className="text-2xl font-semibold text-center text-blue-600 mb-4">
        {ExchangeData.charAt(0).toUpperCase() + ExchangeData.slice(1)} Data
      </h2>
      <DataTable data={data} />
    </div>
  );
}

// DataTable component
const DataTable = ({ data }) => {
  if (!Array.isArray(data) || data.length === 0) {
    return <p className="text-center text-gray-500">loading...</p>;
  }

  // Extract headers dynamically from the first row
  const tableHeaders = Object.keys(data[0]);

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold text-blue-600 mb-6">Exchange Data</h1>

      {/* Table */}
      <div className="overflow-x-auto">
        <table className="table-auto w-full bg-white shadow-md rounded-lg">
          <thead>
            <tr className="bg-blue-500 text-black">
              <th className="px-4 py-2">ID</th>
              <th className="px-4 py-2">Symbol</th>
              <th className="px-4 py-2">Name</th>
              <th className="px-4 py-2">Type</th>
              <th className="px-4 py-2">Currency</th>
              <th className="px-4 py-2">Country</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index} className="border-b hover:bg-gray-100">
                <td className="px-4 py-2">{item.id || "N/A"}</td>
                <td className="px-4 py-2">{item.symbol || "N/A"}</td>
                <td className="px-4 py-2">{item.name || "N/A"}</td>
                <td className="px-4 py-2">{item.type || "N/A"}</td>
                <td className="px-4 py-2">{item.currency || "N/A"}</td>
                <td className="px-4 py-2">{item.country || "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};
